頂寮生態公園位於新城溪北岸，鄰近利澤工業區。園區有一口南北向長條狀生態池，為早期新城溪流過的殘跡。此地保有大片濕地，生態資源十分豐富，故吸引許多候鳥棲息，常見鳥類有小水鴨、黃頭鷺、棕沙燕等。由於此處離海岸較遠，故不會受海浪營力作用，生長植被為苦楝、黃槿等喬木。園區內設有生態池環湖步道與高處觀景台、生態棧道等遊憩設施，能從多種角度體會濕地生態之美。另外，頂寮生態公園也是宜蘭濱海自行車道南段終點，在單車行的尾聲能與水鳥同樂，見證宜蘭濱海豐富多樣化景色。

